let express=require("express");
let app=express();
let port=3000;


app.set("view engine","ejs");
let path=require("path");
app.set("views",path.join(__dirname,"views"));

app.use(express.urlencoded({extended:true}));
app.use(express.static(path.join(__dirname,"public/css")))


var methodOverride = require('method-override');
app.use(methodOverride('_method'))

let { v4: uuidv4 } = require('uuid');




posts= [
    { 
      id:uuidv4(),  
      image: "data:image/jpeg;base64,",
     username:"nitin_chaudhary",
      likes: 200,
      comment:"This cat is very beautiful"
    },
    {
      id:uuidv4(),
      image: "data:image/jpeg;base64,",
      username:"Abhishek_thakur",
      likes: 312,
      comment:"This cat is danger."
    },
    { 
        id:uuidv4(),
      image: "data:image/jpeg;base64,",
      username:"Mohan_rajput",
      likes: 1065,
      comment:"This cat is very angery"
    }
  ]



app.get("/posts",(req,res)=>{
 res.render("insta.ejs",{posts})
 
})

app.get("/posts/new",(req,res)=>{
  res.render("create.ejs")
})

app.post("/posts",(req,res)=>{
  let id=uuidv4();
  let {username ,comment}=req.body;
  posts.push({id,username,comment});
  res.redirect("/posts")
})

app.get("/posts/:id",(req,res)=>{
    let {id}=req.params;
    let post=posts.find((p)=>id===p.id)
   
    res.render("show.ejs",{post})
})




app.patch("/posts/:id",(req,res)=>{
    let {id}=req.params;
    let newbody=req.body.comment;
    let post=posts.find((p)=>id===p.id);
    post.comment=newbody;
    res.redirect("/posts")
})

app.get("/posts/:id/edit",(req,res)=>{
    let {id}=req.params;
    let post=posts.find((p)=>id===p.id);
     res.render("edit.ejs",{post})
})

app.delete("/posts/:id",(req,res)=>{
    let {id}=req.params;
    posts=posts.filter((p)=>id !==p.id);
    res.redirect("/posts")
})




app.listen(port,()=>{
    console.log(`listen port :${port}`)
})


